import { Outlet } from "react-router-dom";
import "../c"

const BlogsLayout = () => {
    return (
    <section className="blogs">
        <div className="container">
            <div className="head">
            <h1>
                Our <span>Blogs</span>
            </h1>
            </div>
        </div>
        <Outlet />
    </section>
    );
}

export default BlogsLayout;
